import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Dashboard from "./Dashboard"; // Import the Dashboard component

// Placeholder components for other pages (you can replace with real ones)
const ManageHome = () => <div className="p-6">Manage Home Page</div>;
const ManageAdmin = () => <div className="p-6">Manage Admin Page</div>;
const ManageAbout = () => <div className="p-6">Manage About Page</div>;
const ManagePortfolio = () => <div className="p-6">Manage Portfolio Page</div>;
const ManagePlaces = () => <div className="p-6">Manage Places Page</div>;
const ManagePackages = () => <div className="p-6">Manage Packages Page</div>;
const ManageContact = () => <div className="p-6">Manage Contact Page</div>;
const ManageSubscriber = () => <div className="p-6">Manage Subscriber Page</div>;
const ManageFooter = () => <div className="p-6">Manage Footer Page</div>;

const App = () => {
  return (
    <Router>
      <Switch>
        {/* Route for the Dashboard */}
        <Route path="/" exact component={Dashboard} />

        {/* Other routes for managing pages */}
        <Route path="/manage-home" component={ManageHome} />
        <Route path="/manage-admin" component={ManageAdmin} />
        <Route path="/manage-about" component={ManageAbout} />
        <Route path="/manage-portfolio" component={ManagePortfolio} />
        <Route path="/manage-places" component={ManagePlaces} />
        <Route path="/manage-packages" component={ManagePackages} />
        <Route path="/manage-contact" component={ManageContact} />
        <Route path="/manage-subscriber" component={ManageSubscriber} />
        <Route path="/manage-footer" component={ManageFooter} />
      </Switch>
    </Router>
  );
};

export default App;
